import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import DashboardView from './views/DashboardView';
import TargetView from './views/TargetView';
import ScanView from './views/ScanView';
import ExploitView from './views/ExploitView';
import ReportView from './views/ReportView';

const App = () => (
  <Router>
    <nav style={{ padding: '1rem', borderBottom: '1px solid #ccc' }}>
      <Link to="/" style={{ marginRight: 16 }}>Dashboard</Link>
      <Link to="/targets" style={{ marginRight: 16 }}>Targets</Link>
      <Link to="/scan" style={{ marginRight: 16 }}>Scan</Link>
      <Link to="/exploits" style={{ marginRight: 16 }}>Exploits</Link>
      <Link to="/reports">Reports</Link>
    </nav>
    <div style={{ padding: '2rem' }}>
      <Routes>
        <Route path="/" element={<DashboardView />} />
        <Route path="/targets" element={<TargetView />} />
        <Route path="/scan" element={<ScanView />} />
        <Route path="/exploits" element={<ExploitView />} />
        <Route path="/reports" element={<ReportView />} />
      </Routes>
    </div>
  </Router>
);

export default App;
